        [Fact]
        public void ToString_SFormat_FormatsNumberWithGivenDigitsAfterRadixForCurrentCulture()
        {
            var oldCulture = CultureInfo.CurrentUICulture;
            try
            {
                CultureInfo.CurrentUICulture = CultureInfo.InvariantCulture;
                Assert.Equal("0.1 mm/(m.K)", new ThermalLengthExpansion(0.123456, ThermalLengthExpansionUnit.MillimeterPerMeterKelvinDegree).ToString("s1"));
                Assert.Equal("0.12 mm/(m.K)", new ThermalLengthExpansion(0.123456, ThermalLengthExpansionUnit.MillimeterPerMeterKelvinDegree).ToString("s2"));
                Assert.Equal("0.123 mm/(m.K)", new ThermalLengthExpansion(0.123456, ThermalLengthExpansionUnit.MillimeterPerMeterKelvinDegree).ToString("s3"));
                Assert.Equal("0.1235 mm/(m.K)", new ThermalLengthExpansion(0.123456, ThermalLengthExpansionUnit.MillimeterPerMeterKelvinDegree).ToString("s4"));
            }
            finally
            {
                CultureInfo.CurrentUICulture = oldCulture;
            }
        }

