            Assert.Equal("0.12 mm/(m.K)", new ThermalLengthExpansion(0.123456, ThermalLengthExpansionUnit.MillimeterPerMeterKelvinDegree).ToString("s2", culture));
            Assert.Equal("0.123 mm/(m.K)", new ThermalLengthExpansion(0.123456, ThermalLengthExpansionUnit.MillimeterPerMeterKelvinDegree).ToString("s3", culture));
            Assert.Equal("0.1235 mm/(m.K)", new ThermalLengthExpansion(0.123456, ThermalLengthExpansionUnit.MillimeterPerMeterKelvinDegree).ToString("s4", culture));
